/// <summary>
/// Refreshes the packing UI. Should be public as it will be called from other forms.
/// </summary>
public void refreshFormAfterPacking()
{
    this.refreshAllData();
    this.refreshFormAfterChangesToTmpPackingLines();
}

/// <summary>
/// Refreshes all data sources in the form with data from the database.
/// </summary>
private void refreshAllData()
{
    element.doRefresh();
}

/// <summary>
/// Refreshes the UI when contents of the <c>WhsTmpPackingLine</c> table have been updated.
/// </summary>
private void refreshFormAfterChangesToTmpPackingLines()
{
    itemId.text('');
    qty.realValue(1);

    whsTmpPackingLine_ds.research();
    whsTmpPackingLine_Open_ds.research();

    element.updateSummaryFields();
    element.toggleControls();
    element.enableScanningFieldsForContainer();

    itemId.setFocus();
}

private WHSInstrumentationLogger instrumentationLogger()
{
    if (!logger)
    {
        logger = WHSInstrumentationLogger::createLogger(classId2Name(classIdGet(this)));
    }

    return logger;
}

/// <summary>
