private void updateFormWithSelectedContainer()
{
    WHSContainerTable containerTable = WHSContainerTable::find(shipmentId, containerId.valueStr());

    containerTypeCode.text(containerTable.ContainerTypeCode);

    this.setContainerPolicyText(containerTable);

    openContainerGroupingLicensePlateId.text(containerTable.ContainerGroupingLicensePlateId);

    element.updateSummaryFields();
    element.toggleControls();
    element.enableScanningFieldsForContainer();

    ItemId.setFocus();
}

