/// <summary>
/// Pack based on the scanning fields.
/// </summary>
protected void packFromScanningFields()
{        
    ItemId          packingItemId           = ItemId.valueStr();
    Qty             packingItemQuantity     = Qty.realValue();
    WHSContainerId  packingContainerId      = containerId.valueStr();

    whsPackForm.buttonPack_clicked(packingContainerId,
                                   packingItemId,
                                   packingItemQuantity,
