/// <summary>
/// Determines if system is set up to use packing.
/// </summary>
/// <returns>
/// True, if the packing station form can be opened, otherwise false
/// </returns>
private boolean canPackingStationFormBeOpened()
{
    boolean             canPackingStationBeOpened = true;

    if (!WHSParameters::canUsePackFunctionality())
    {
        canPackingStationBeOpened = checkFailed("@WAX:PackingFunctionalityIsNotConfigured");
    }

    return canPackingStationBeOpened;
}

public void init()
{
    whsPackForm = new WHSPackForm();
    whsPackForm.parmPackForm(element);
    inventItemSearch = InventInventItemSearch::construct();

    super();

    if (element.canPackingStationFormBeOpened() && element.setPackProfile())
    {
        element.updateDesign(InventDimFormDesignUpdate::Init);

        whsShipmentTable_ds.query().dataSourceTable(tableNum(WHSShipmentTable)).addRange(fieldNum(WHSShipmentTable, ShipmentId)).value(strFmt("%1,''", shipmentId));

        element.toggleControls();
    }
    else
    {
        element.close();
    }

    packStationLocation = WMSLocation::find(InventDimPackingLocation_wMSLocationId.text(), InventDimPackingLocation_InventLocationId.text());
}

