private boolean LPOrShipmentIdModified(WHSTargetLicensePlateId  _value)
{
    boolean                 ret = true;
    QueryBuildDataSource    qbds;
    boolean                 multiShipments;

    [shipmentId, multiShipments] = whsPackForm.getShipmentId(_value);

    if (WHSShipmentTable::isShipmentInProgress(shipmentId))
    {
        qbds = whsShipmentTable_ds.query().dataSourceTable(tableNum(WHSShipmentTable));
        qbds.clearRanges();
        qbds.addRange(fieldNum(WHSShipmentTable, ShipmentId)).value(SysQuery::value(shipmentId));

        element.resetForm();
        containerId.setFocus();
        multipleShipmentIds = multiShipments;
    }
    else
    {
        if (shipmentId)
        {
            ret = checkFailed(strFmt("@WAX:ShipmentIsShippedOrLoaded", shipmentId));
            shipmentId = '';
        }
        else
        {
            ret = checkFailed("@WAX1081");
        }

        whsTmpPackingLine.setTmpData(WHSTmpPackingLine::populatePackingLines());
        whsTmpPackingLine_Open.setTmpData(whsTmpPackingLine);

        lpOrShipmentId.text('');
        element.resetForm();
        multipleShipmentIds = false;
    }

    return ret;
}

public void resetForm()
{
    itemId.text('');
    qty.realValue(1);
    containerId.text('');
    containerTypeCode.text('');
    ContainerPolicy.text('');
    openContainerGroupingLicensePlateId.text('');
    inventDimId = '';
    notes.text(whsPackForm.resetForm(shipmentId));

    element.updateSummaryFields();

    fieldShipmentId.text(shipmentId);

    whsShipmentTable_ds.executeQuery();
    whsTmpPackingLine_ds.executeQuery();

    element.toggleControls();
}

/// <summary>
/// Sets container fields on the form after a container is closed based on packing profile configurations.
/// </summary>
public void setContainerFieldsAfterClose()
{
    WHSContainerTable   locContainerTable;
    WHSContainerId      newContainerId;

    // Only change if container was closed.
    locContainerTable = WHSContainerTable::find(whsShipmentTable.ShipmentId, containerId.valueStr());
    if (locContainerTable.ContainerStatus == WHSContainerStatus::Closed)
    {
        if (whsPackProfile.AutoContainerOnClose
            && WHSTmpPackingLine::hasUnPackedLineForShipment(whsTmpPackingLine, whsShipmentTable.ShipmentId))
        {
            newContainerId = WHSContainerTable::generateContainerId();

            WHSWorker worker = WHSWorker::findByWorker();
            WHSCreateContainerParameters createContainerParameters = WHSCreateContainerParameters::createFromParameters(
                whsShipmentTable.ShipmentId,
                newContainerId,
                whsPackProfile.DefaultContainerType,
                CloseContainerProfileId.text(),
                '',
                packStationLocation,
                whsPackProfile.PrintContainerLabel,
                '',
                worker.RecId);
            WHSContainerTable::createContainerWithParameters(createContainerParameters);

            containerId.text(newContainerId);
        }
        else
        {
            containerId.text('');
            containerTypeCode.text('');
            ContainerPolicy.text('');
            openContainerGroupingLicensePlateId.text('');
        }
    }
}

/// <summary>
/// Sets the pack profile for the current worker.
/// </summary>
/// <returns>
/// True if the profile is set correctly; otherwise, false.
/// </returns>
private boolean setPackProfile()
{
    WHSWorker       worker;
    FormRun         packProfileSelectDlg;
    Object          packProfileSelectDlgObj;
    Args            args = new Args();

    args.name(formStr(WHSPackProfileSelectDialog));
    packProfileSelectDlg = classfactory.formRunClass(args);
    packProfileSelectDlg.init();
    packProfileSelectDlg.run();
    packProfileSelectDlg.wait();

    if (packProfileSelectDlg.closedOk())
    {
        packProfileSelectDlgObj = packProfileSelectDlg;
        whsPackProfile_q.dataSourceTable(tableNum(WHSPackProfile)).addRange(fieldNum(WHSPackProfile, PackProfileId)).value(packProfileSelectDlgObj.parmPackProfileId());
        whsPackProfile.data(WHSPackProfile::find(packProfileSelectDlgObj.parmPackProfileId()));
        whsPackProfile.reread();

        if (whsPackProfile.CloseContainerProfileId)
        {
            CloseContainerProfileId.text(whsPackProfile.CloseContainerProfileId);
        }
        else
        {
            worker = WHSWorker::findByWorker(packProfileSelectDlgObj.parmWorkerRecId());
            if (worker.CloseContainerProfileId)
            {
                CloseContainerProfileId.text(worker.CloseContainerProfileId);
            }
            else
            {
                CloseContainerProfileId.allowEdit(true);
            }
        }

        InventDimPackingLocation_InventLocationId.text(packProfileSelectDlgObj.parmInventLocationId());
        InventDimPackingLocation_wMSLocationId.text(packProfileSelectDlgObj.parmWMSLocationId());

        return true;
    }

    return false;
}

public void toggleControls()
{
    boolean hasShipmentId = shipmentId != null;
    boolean isShipmentInProgress = WHSShipmentTable::isShipmentInProgress(shipmentId);

    WHSShipmentDetails.enabled(shipmentId && FieldShipmentId.text() != '');
    WHSContainerTableContainersForShipment.enabled(shipmentId && whsPackForm.parmNumContainers() > 0);

    buttonAddContainer.enabled(isShipmentInProgress && CloseContainerProfileId.text());
    buttonCloseContainer.enabled(
        whsPackForm.shouldCloseContainerButtonBeEnabled(shipmentId, containerPolicy.text(), ContainerManifestRequirements.checked()));

    buttonPack.enabled(hasShipmentId && ContainerId.text() && !ContainerTrackingId.text());
    containerId.enabled(hasShipmentId);
    WHSManifestShipments.enabled(
           hasShipmentId
        && WHSShipmentTable.CarrierCode
        && WHSShipmentTable.CarrierServiceCode
        && whsPackForm.parmNumContainers() > 0);
    WHSManifestContainer.enabled(
           hasShipmentId
        && !ContainerTrackingId.text()
        && TotalQty.realValue() > 0
        && WHSCloseContainerProfile::find(ContainerPolicy.text()).ManifestRequirementsForContainer != WHSManifestRequirement::None);
    WHSShipmentReleaseDiag.enabled(FieldShipmentId.text() != '');
    btnUnmanifest.enabled(hasShipmentId && ContainerTrackingId.text());
    this.toggleContainerGroupingLicensePlateId();
    WHSManifestContainerGroup.enabled(ContainerGroupingLicensePlateId.text() != '');
    btnUnmanifestContainerGroup.enabled(ContainerGroupingLicensePlateId.text() != '');
    UnmanifestShipment.enabled(FieldShipmentId.text() != '');
}

private void toggleContainerGroupingLicensePlateId()
{
    WHSCloseContainerProfile packingStationContainerPackingPolicy = WHSCloseContainerProfile::find(closeContainerProfileId.text());

    containerGroupingLicensePlateId.enabled(whsPackForm.shouldContainerGroupingLicensePlateIdFieldBeEnabled(shipmentId, packingStationContainerPackingPolicy));

    if (!containerGroupingLicensePlateId.enabled() && containerGroupingLicensePlateId.text())
    {
        if (packingStationContainerPackingPolicy.AutoReleaseContainerAtContainerClose == WHSAutoReleaseContainerAtContainerClose::Always)
        {
            info("@WAX:MessageContainerGroupLicensePlateIdCannotBeUsedWithAutomaticRelease");
        }

        if (packingStationContainerPackingPolicy.ContainerClosingWorkCreationProcess == WHSWarehouseContainerClosingWorkCreationProcess::None)
        {
            info("@WAX:MessageContainerGroupLicensePlateIdCannotBeUsedWithMakeAvailableAtFinalShipLoc");
        }

        containerGroupingLicensePlateId.text('');
    }
}

public void updateDesign(InventDimFormDesignUpdate _mode)
{
    switch (_mode)
    {
        case InventDimFormDesignUpdate::Init:
            element.inventDimSetupObject();

        case InventDimFormDesignUpdate::Active:
            element.inventDimSetupObject().formActiveSetup();
            element.inventDimSetupObject().formSetControls(true);
            break;

        default:
            throw error(strFmt("@SYS54195", funcName()));
    }
}

/// <summary>
/// Updates the summary fields.
/// </summary>
protected void updateSummaryFields()
{
    whsPackForm.updateSummaryFields(shipmentId, containerId.valueStr());
    totalContainers.realValue(any2real(whsPackForm.parmNumContainers()));
    totalQty.realValue(whsPackForm.parmContainerQty());
    totalWeight.realValue(whsPackForm.parmContainerWeight());
    totalItems.realValue(any2real(whsPackForm.parmItemCount()));

    ContainerTrackingId.text(WHSContainerTable::findByContainerId(containerId.text()).ShipCarrierTrackingNum);

    if (FieldShipmentId.text() && containerId.text())
    {
        ContainerManifestRequirements.checked(WHSContainerTable::find(FieldShipmentId.text(), containerId.text()).isContainerManifestRequirementsMet() );
    }
    else
    {
        ContainerManifestRequirements.checked(false);
    }
}

