void clicked()
{
    WHSTmpPackingLine       packLine;
    MultiSelectionHelper    helper = MultiSelectionHelper::construct();

    super();

    helper.parmDatasource(WHSTmpPackingLine_Open_DS);

    // Traverse all selected open packing lines
    packLine = helper.getFirst();

    if (packLine.RecId)
    {
        while (packLine.RecId != 0)
        {
            whsPackForm.buttonPack_clicked(containerId.valueStr(),
                                       packLine.ItemId,
                                       packLine.QtyRemaining,
                                       whsTmpPackingLine,
                                       packLine.InventDimId);

            packLine = helper.getNext();
        }

        using (var activityContext = element.instrumentationLogger().warehouseItemPackingInContainer().refreshFormAfterClickingPackButton())
        {
            element.refreshFormAfterPacking();
        }
    }
}

