public void clicked()
{
    WHSCloseContainerProfile closeContainerProfile = WHSCloseContainerProfile::find(ContainerPolicy.text());

    if (closeContainerProfile.ManifestRequirementsForContainer == WHSManifestRequirement::None)
    {
        throw error("@WAX:TheContainerPolicyForTheContainerDoNotAllowManifesting");
    }

    Args            args = new Args();

    args.name(formStr(WHSManifestShipmentContainers));
    args.record(WHSContainerTable::find(FieldShipmentId.text(), ContainerId.text(), true));
    args.parmEnumType(enumNum(WHSShipmentManifestType));
    args.parmEnum(WHSShipmentManifestType::Container);
    var manifestContainer = classfactory.formRunClass(args);
    manifestContainer.init();
    manifestContainer.run();

    if (!manifestContainer.closed())
    {
        manifestContainer.wait();
    }

    element.updateSummaryFields();
    element.enableScanningFieldsForContainer();
    element.toggleControls();
}

void clicked()
{
    var containerToUnmanifest = WHSContainerTable::find(FieldShipmentId.text(), ContainerId.text(), true);
    if (WHSCloseContainerProfile::find(ContainerPolicy.text()).ManifestRequirementsForContainer == WHSManifestRequirement::Manual)
    {
        containerToUnmanifest.unManifestContainerManual();
    }
    else
    {
        containerToUnmanifest.unmanifestContainerWithTransportationManagement();
    }

    element.updateSummaryFields();
    element.enableScanningFieldsForContainer();
    element.toggleControls();
}

public void clicked()
{
    WHSContainerTable        containerInGroup      = WHSContainerTable::findFirstContainerInGroupOnShipment(FieldShipmentId.text(), ContainerGroupingLicensePlateId.text());
    WHSCloseContainerProfile closeContainerProfile = WHSCloseContainerProfile::find(containerInGroup.CloseContainerProfileId);

    if (containerInGroup.RecId == 0)
    {
        throw error(strFmt("@WAX:ThereAreNoContainersInTheContainerGroup", ContainerGroupingLicensePlateId.text()));
    }

    if (WHSContainerGroupManifest::find(containerInGroup.ContainerGroupingLicensePlateId))
    {
        throw error(strFmt("@WAX:ContainerGroupIsAlreadyManifested", containerInGroup.ContainerGroupingLicensePlateId));
    }

    if (closeContainerProfile.ManifestRequirementsForContainerGroup == WHSManifestRequirementContainerGroup::None)
    {
        throw error("@WAX:TheContainerPolicyForTheContainerDoNotAllowManifesting");
    }

    Args            args = new Args();

    args.name(formStr(WHSManifestShipmentContainers));
    args.record(WHSContainerTable::find(FieldShipmentId.text(), containerInGroup.ContainerId, true));
    args.parmEnumType(enumNum(WHSShipmentManifestType));
    args.parmEnum(WHSShipmentManifestType::ContainerGroup);
    var manifestContainer = classfactory.formRunClass(args);
    manifestContainer.init();
    manifestContainer.run();

    if (!manifestContainer.closed())
    {
        manifestContainer.wait();
    }

    element.updateSummaryFields();
    element.enableScanningFieldsForContainer();
    element.toggleControls();
}

public void clicked()
{
