public void clicked()
{
    WHSContainerTable containerTable;

    select firstonly containerTable
        where containerTable.ShipmentId == shipmentId;

    if (containerTable.MasterTrackingNum)
    {
        var shipmentTable = WHSShipmentTable::find(shipmentId);
        shipmentTable.unmanifest(containerTable);
    }
    else
    {
        throw error("@WAX:TheShipmentIsNotManifestedAndCantBeUnmanifested");
    }
}

public void clicked()
{
    WHSShipmentId releaseShipmentId = FieldShipmentId.text();
    boolean createWorkCreatePolicy = !WHSShipmentTable::doesContainerOnShipmentHasNonWorkCreationPackingPolicy(releaseShipmentId);

    if (createWorkCreatePolicy)
    {
        WHSShipmentTable::find(FieldShipmentId.text()).releaseContainersOnShipment();
    }
    else
    {
        WHSShipmentTable::moveContainerToFinalLocation(releaseShipmentId);
    }
}

public boolean modified()
{
    boolean ret;
    str     lpOrShipmentIdValue = this.valueStr();

    ret = super();

    using (var activityContext = element.instrumentationLogger().warehouseItemPackingInContainer().lpOrShipmentIdModified())
    {
        if (ret && lpOrShipmentIdValue)
        {
            ret = element.LPOrShipmentIdModified(lpOrShipmentIdValue);
            FieldShipmentId.allowEdit(multipleShipmentIds);
        }
        else
        {
            shipmentId = '';
            FieldShipmentId.text(shipmentId);

            whsPackForm.parmNumContainers(0);
            WHSShipmentTable_DS.executeQuery();
        }

        element.updateSummaryFields();
        element.enableScanningFieldsForContainer();
        element.toggleControls();
    }

    return ret;
}

