public boolean validate()
{
    boolean ret = super();

    if (ret && this.text())
    {
        WHSContainerTable containerTable = WHSContainerTable::findByContainerId(this.text());

        ret = containerTable.validateContainerForPacking(fieldShipmentId.text(), packStationLocation);
    }

    element.enableScanningFieldsForContainer(ret);

    return ret;
}

public boolean modified()
{
    boolean ret = super();

    if (ret && ItemId.text())
    {
        var unitId = WHSCatchWeightHelper::inventHandlingUnitId(ItemId.text());

        if (unitId)
        {
            var packQty = decRound(this.realValue(), UnitOfMeasure::findBySymbol(unitId).DecimalPrecision);
            this.realValue(packQty ? packQty : 1);
        }
    }

    return ret;
}

