public boolean modified()
{
    boolean ret = super();

    using (var fullActivityContext = element.instrumentationLogger().warehouseItemPackingInContainer().packOneOrMoreItems())
    {
        if (this.valueStr())
        {
            InventInventItemSearchResult result = inventItemSearch.search(this.valueStr());

            if (!result ||
                !result.parmItemId())
            {
                ret = checkFailed("@WAX758");
                return ret;
            }
            else
            {
                this.text(result.parmItemId());

                if (!qty.realValue())
                {
                    qty.realValue(1);
                }
                else
                {
                    var packQty = decRound(qty.realValue(),
                        UnitOfMeasure::findBySymbol(
                            WHSCatchWeightHelper::inventHandlingUnitId(result.parmItemId())).DecimalPrecision);

                    qty.realValue(packQty ? packQty : 1);
                }

                inventDimId = result.parmInventDimId();

                try
                {
                    element.packFromScanningFields();
                }
                catch
                {
                    // Catch the exception, only show the actual error to the user
                    // The reason is that we want to accept the user value entered.
                }
            }
        }

        element.toggleControls();
    }

    return ret;
}

public void lostFocus()
{
    // Calling this to retain the focus on item id while capturing serial number at packing station.
    super();
}
